var initialState = [
    {
        id : 1,
        name : 'iPhone 6 Plus',
        image : 'data:image/jpeg;base64,',
        description : "Here is product 666 newst of us",
        price : 500,
        inventory : 10,
        rating : 3
    },
    {
        id : 2,
        name : 'iPhone X',
        image : 'data:image/jpeg;base64,',
        description : "Here is product XXX newst of us",
        price : 200,
        inventory : 50,
        rating : 4
    },
    {
        id : 3,
        name : 'iPhone 5S',
        image : '',
        description : "Here is product 5S newst of us",
        price : 350,
        inventory : 12,
        rating : 5
    },
]

const products = (state = initialState, action) => {    
    switch(action.type){
        default: 
            return [...state];
    }

}

export default products;
